import React, { Component } from 'react';


const Styledimg = styled.button`
width: 284px;
height: 246px;
`;


function Card1() {
    return (
        <Styledimg>

                <img className="phoneImage" alt="iPhone_01" src="../../../public/intro.png" />

        </Styledimg>

    )
}

export default Card1;
